import React from "react";
import Titles from "./component/Titles";
import Form from "./component/Form";
import Weather from "./component/Weather"

class App extends React.Component {
  render() {
    return (
      <div>
        <Titles/>
        <Form />
        <Weather />
      </div>
    );
  }
}

export default App;
